commits.sourceNew:
@Override
public int compare(final Edge edge, final Edge addEdge) {
  if (edge.planeBounds.getMaximumX() < addEdge.planeBounds.getMinimumX()) {
    return 1;
  } else if (edge.planeBounds.getMinimumX() > addEdge.planeBounds.getMaximumX()) {
    return -1;
  }
  return 0;
}

